#include <iostream>using namespace std;int arr[13]; int arr2[13];int k; //6<k<13void func(int first,int depth){	if (depth == 6) {		for (int i = 0; i < 6; i++) {			cout << arr2[i]<<" ";		}		cout << '\n';		return;	}	for (int i = first; i < k; i++) {		arr2[depth] = arr[i];		func(i + 1, depth + 1);	}}int main() {	while (1) {		cin >> k;		if (k == 0) break;		for (int i = 0; i < k; i++) {			cin >> arr[i];		}		func(0, 0);		cout << '\n';	}}